import { useEffect, useState } from "react";

import { signOut, getAuth } from "firebase/auth"
import { initializeApp } from "firebase/app";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import Pagination from "./Pagination";
import UseAuth from "./user";

import "./Home.css"





function EmpData1(event) {
    const [data, setData] = useState([])
    const [value, setValue] = useState("")

  
     let currentUser=UseAuth()

    const navigate = useNavigate()
    const firebaseConfig = {
        apiKey: "AIzaSyBmbt0GWdLp3LfPsR0foJZMFQysZfJmkmo",
        authDomain: "narasimha-4cf38.firebaseapp.com",
        projectId: "narasimha-4cf38",
        storageBucket: "narasimha-4cf38.appspot.com",
        messagingSenderId: "931387859079",
        appId: "1:931387859079:web:f9e2c4cc056cbf78c51822",
        measurementId: "G-FP2FFCJCJL"
    };
    const app = initializeApp(firebaseConfig)
    const auth = getAuth()

    const SubmitData = (event) => {

        event.preventDefault()

        signOut(auth)
            .then(() => {
                alert("log out succesfully")
                navigate("/login")
            })
            .catch(() => {
                alert("error")
            })
    }





    useEffect(() => {

        fetch("   http://localhost:3006/subscription")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                // console.log(resp)
                setData(resp)
            })
    }, [])



    const search = async (lkj) => {
        lkj.preventDefault()
        return await axios.get(`http://localhost:3006/subscription?q=${value}`)
            .then((go) => {
                setData(go.data)
            })
            .catch((err) => {
                console.log(err)
            })
           
    }

    // const sort = async (lkj) => {
    //     lkj.preventDefault()
    //     return await axios.get(`http://localhost:3006/subscription?q=${value}`)
    //         .then((go) => {
    //             setData(go.data)
    //         })
    //         .catch((err) => {
    //             console.log(err)
    //         })
    // }


const addcart=(id)=>{
    fetch(" http://localhost:3006/subscription/"+id)
    .then((sun)=>{
        return sun.json()
    })
    .then((resp)=>{
        fetch("http://localhost:3006/addcart",{
        method:"POST",
        headers:{"content-type":"application/json"},
        body:JSON.stringify(resp)
        })
        .then(()=>{
            alert("add cart suuess")
        })
    })
}


const Deatails=(deatails)=>{
    fetch(" http://localhost:3006/subscription/"+deatails)
    .then((sun)=>{
        return sun.json()
    })
    .then((resp) => {
        // console.log(resp)
        setData(resp)
    })
} 

const [page,setPage]=useState(1)
const [records,setRecord]=useState(4)

let lr=page*records
let fr=lr-records
 

let myData=data.slice(fr,lr)

const updatePage=(n)=>{
    setPage(n)
}
const next=()=>{
    setPage(page+1)
}
const prev=()=>{
    setPage(page-1)
}

    return (

        
        <div>
        
            <nav className="navbar bg-dark border-bottom border-body" data-bs-theme="dark" >

                <div className="container-fluid">
                    <h2>currentUser:{currentUser?.email}</h2>
                    <a className="navbar-brand"><img src="https://cdn.dribbble.com/users/2370732/screenshots/9920313/media/ec7d0a1483c259f24debe462685820fc.png" style={{ height: "50px", width: "50px" }} /></a>
                    <a className="navbar-brand"><i class="fa-solid fa-house fa-beat-fade fa-lg"></i></a>
                    <Link to="/addcart">
                        <a className="navbar-brand"><i class="fa-solid fa-cart-shopping fa-bounce fa-lg"></i> </a>
                    </Link>

                    <form className="d-flex" role="search" onSubmit={search}>
                        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" value={value} onChange={(s) => setValue(s.target.value)} />
                        <button className="btn btn-outline-success" type="submit">Search  </button> <i className="fa-brands fa-react"></i>

                    </form>

                    <button className="btn btn-outline-success" onClick={SubmitData} type="text">logout</button>
                </div>
            </nav>
            

            <h1 style={{ textAlign: "center" }}>CLOTHES FOR MENS & WOMENS</h1>
            <div id="sun" >


                {myData.map((item) => (
                    <div className="card" style={{ width: "18rem", boxShadow: "gray 5px 5px 5px" }}>

                        <img src={item.img} class="card-img-top" alt="..." style={{ height: "200px", }} />

                        <div className="card-body">

                            <h5 className="card-title">{item.brand}</h5>
                            <p className="card-text">{item.size}</p>
                            <p>{item.description}</p>
                            <h3 >Rs: {item.price}</h3>
                            <a href="#" className="btn btn-primary" onClick={()=>{addcart(item.id)}}>Add To Cart (+)</a>
                            <a href="#" className="btn btn-primary" > Deatails</a>
                        </div>

                    </div>

                ))}

            </div>
